import React from 'react';
import Navbar from './components/Navbar';
import './App.css';
import Main from './components/Main-container';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import ImageSlider from './Slider';

function App() {
  return (
    <>
      <Router>
        <Navbar />

        <Main/>
        <ImageSlider/>
      </Router>
    </>
  );
}

export default App;
